Real Wife Stories - Sarah Vandella - Night Of Surprises

January 10, 2011

Sarah has been out of sight for a minute and she finally gets a dinner invitation from her husband. It builds up to be a moment they can work on their relationship but her husband resorts to the bad habit of ignoring her. Danny the stranger sitting at the bar notices her loneliness and offers to show her a night of surprises.

Pornstars: Sarah Vandella, Danny Mountain
